// ==UserScript==
// @name        Remove blurry Avatars
// @namespace   https://github.com/Official-Husko/violentmonkey-scripts
// @match       https://spicychat.ai/*
// @grant       none
// @version     1.0.1
// @author      Official Husko
// @license     GNU GPLv3
// @icon        data:image/png;base64,
// @description No more blurry avatars while chatting!
// @downloadURL https://update.greasyfork.org/scripts/482294/Remove%20blurry%20Avatars.user.js
// @updateURL https://update.greasyfork.org/scripts/482294/Remove%20blurry%20Avatars.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Define the pattern to match the new URLs
    const newImagePattern = /https:\/\/nd-sc\.b-cdn\.net\/spicychat-ik\/avatars\/.*\.(png|jpg|jpeg|gif|webp)\?tr=w-\d+,f-webp,h-\d+,fo-top/g;

    // Replace the matched URLs with modified ones
    function replaceNewImageURLs() {
        const images = document.querySelectorAll('img');
        images.forEach(img => {
            let originalSrc = img.getAttribute('src');
            if (originalSrc && newImagePattern.test(originalSrc)) {
                let newSrc = originalSrc.replace(/\?tr=w-\d+,f-webp,h-\d+,fo-top/g, '');
                img.setAttribute('src', newSrc);
            }
        });
    }

    // Observe the DOM for changes and update images when needed
    const observer = new MutationObserver(replaceNewImageURLs);
    const config = { childList: true, subtree: true };
    observer.observe(document.body, config);

    // Initial replacement for new images
    replaceNewImageURLs();
})();